{ 
  "baseRefName": "main",
  "body": "## Summary\r\n\r\nComprehensive fix for SQLite3 system library installation to ensure reliable IPA compilation in GitHub Actions CI.\r\n\r\n### Problem\r\n\r\nThe CI workflows had fragile library selection logic using `grep` patterns that could select the wrong SQLite slice (simulator vs device), causing build failures or incorrect binaries.\r\n\r\n### Solution\r\n\r\n- **Standardized cache key** (`v3`) across all workflows for consistent XCFramework caching\r\n- **Explicit XCFramework path patterns** instead of grep-based text matching\r\n- **Test script auto-detection** of custom SQLite library\r\n- **Added SQLite to ballistics-tests** job (was missing)\r\n\r\n## Changes\r\n\r\n### 1. Library Selection - Before vs After\r\n\r\n|\r\n Before (Fragile) \r\n|\r\n After (Reliable) \r\n|\r\n|\r\n------------------\r\n|\r\n------------------\r\n|\r\n|\r\n`grep \"simulator\"`\r\n|\r\n`find -path \"*ios-*-simulator*\"`\r\n|\r\n|\r\n`grep -v \"simulator\"`\r\n|\r\n`find -path \"*ios-arm64\"`\r\n|\r\n\r\n### 2. Files Modified\r\n\r\n|\r\n File \r\n|\r\n Change \r\n|\r\n|\r\n------\r\n|\r\n--------\r\n|\r\n|\r\n`.github/workflows/ci.yml`\r\n|\r\n Standardized library selection, added SQLite to ballistics-tests \r\n|\r\n|\r\n`.github/workflows/release.yml`\r\n|\r\n Standardized library selection for Release builds \r\n|\r\n|\r\n`.github/workflows/sqlite-verification.yml`\r\n|\r\n Updated path patterns \r\n|\r\n|\r\n`scripts/run-db-tests.sh`\r\n|\r\n Auto-detect custom SQLite in \r\n`sqlite-link/`\r\n|\r\n|\r\n`scripts/run-ballistics-tests.sh`\r\n|\r\n Auto-detect custom SQLite in \r\n`sqlite-link/`\r\n|\r\n\r\n### 3. Build Configuration\r\n\r\n|\r\n Build Type \r\n|\r\n SDK \r\n|\r\n SQLite Slice Pattern \r\n|\r\n|\r\n------------\r\n|\r\n-----\r\n|\r\n---------------------\r\n|\r\n|\r\n Debug \r\n|\r\n iphonesimulator \r\n|\r\n`*ios-*-simulator*`\r\n|\r\n|\r\n Release \r\n|\r\n iphoneos \r\n|\r\n`*ios-arm64`\r\n (excludes simulator) \r\n|\r\n\r\n## Test plan\r\n\r\n- [ ] CI workflow runs with all test jobs passing\r\n- [ ] Debug build uses simulator slice correctly\r\n- [ ] Release build uses device slice correctly  \r\n- [ ] IPA artifact is created successfully\r\n- [ ] SQLite verification workflow passes (merge gate)\r\n- [ ] Custom SQLite 3.51.1 is linked (not system SQLite)\r\n\r\nCommits included:\r\n\r\ncbc5640 - fix(ci): standardize SQLite3 library installation for reliable IPA compilation\r\nd06d94d - refactor(ci): use explicit XCFramework path patterns for library selection",                              
  "commits": [
