      "committedDate": "2026-01-15T19:49:06Z",
      "messageBody": "ΓÇªmpilation\n\n- Standardize XCFramework cache key to v3 across all workflows (ci.yml, release.yml)\n- Fix library path discovery to reliably select device vs simulator slices:\n  - Use `grep \"simulator\"` for macOS host tests (compatible with arm64)\n  - Use `grep -v \"simulator\"` for device Release builds\n- Add SQLite preparation step to ballistics-tests job in CI\n- Update test scripts to detect and use custom SQLite library when available:\n  - run-db-tests.sh: Check for sqlite-link directory\n  - run-ballistics-tests.sh: Check for sqlite-link directory\n- Add verbose logging for library selection debugging\n\nThis ensures consistent SQLite 3.51.1 usage across all CI jobs and\nreliable IPA compilation for both Debug (simulator) and Release (device) builds.",    
      "messageHeadline": "fix(ci): standardize SQLite3 library installation for reliable IPA coΓÇª",                                                              
