      "committedDate": "2026-01-15T19:55:29Z",
      "messageBody": "ΓÇªction\n\nReplace fragile grep-based library selection with explicit XCFramework\ndirectory path matching:\n\n- Simulator: find -path \"*ios-*-simulator*\" (matches ios-arm64-simulator/)\n- Device: find -path \"*ios-arm64\" (matches ios-arm64/ without simulator suffix)\n\nThis approach is more reliable because it uses the predictable XCFramework\ndirectory structure created by xcodebuild -create-xcframework rather than\ntext matching on arbitrary path components.\n\nAlso:\n- Copy headers from the same slice directory for consistency\n- Add detailed logging of XCFramework structure for debugging\n- Maintain proper fallback chain if expected paths not found",                                 
      "messageHeadline": "refactor(ci): use explicit XCFramework path patterns for library seleΓÇª",                                                              
      "oid": "d06d94dd009e0761b91769bbb49cb2d9616b72f3"
    },
    {
      "authoredDate": "2026-01-15T20:22:37Z",
