          "login": "claude",
          "name": "Claude"
        }
      ],
      "committedDate": "2026-01-15T20:22:37Z",
      "messageBody": "- Create scripts/select-sqlite-lib.sh with reusable functions:\n  - select_sqlite_lib(): Select correct library from XCFramework\n  - prepare_sqlite_link(): Copy library and headers to sqlite-link/\n\n- Fix path patterns to match files INSIDE directories:\n  - Before: -path \"*ios-arm64\" (matches directory, not files)\n  - After: -path \"*ios-arm64/*\" (matches files inside directory)\n\n- Add grep -v simulator to device selection to avoid false matches\n\n- Update all workflows to use helper script:\n  - ci.yml: core-tests, ballistics-tests, database-tests, ios-build\n  - release.yml: run-tests, create-release\n  - sqlite-verification.yml: verify-binary-linking\n\nThis fixes the failing CI checks by ensuring the find command\ncorrectly locates .a files within the XCFramework slice directories.",                                                  
      "messageHeadline": "fix(ci): extract SQLite library selection into reusable helper script",                                                               
      "oid": "4f77b0c3a685082ac5d9ea9cf74149f40a0d578e"
    },
