      "committedDate": "2026-01-15T20:32:01Z",
      "messageBody": "- Fix device library selection: use `! -path \"*simulator*\"` with find\n  instead of grep to properly exclude simulator paths\n  (Pattern *ios-arm64/* matches both ios-arm64/ and ios-arm64-simulator/)\n\n- Use simpler simulator pattern: *-simulator/* instead of *ios-*-simulator/*\n\n- Fix corrupted UTF-8 checkmark characters in test scripts\n  (Replace with ASCII [OK] for portability)",                                                                    
      "messageHeadline": "fix(ci): correct XCFramework path patterns and fix encoding",                                                                         
      "oid": "5c7b2ab31cba3a8306ea17d5a18eb50d7c0da014"
