      "committedDate": "2026-01-15T20:40:53Z",
      "messageBody": "iOS XCFramework libraries (compiled with -sdk iphonesimulator) cannot\nbe linked into native macOS executables. The custom SQLite is only\nneeded for iOS app builds via xcodebuild.\n\nFor C tests running on macOS (core-tests, ballistics-tests, database-tests):\n- Remove XCFramework download and prepare steps\n- Use system SQLite via -lsqlite3 (macOS ships with SQLite)\n- These tests verify C engine logic, not custom SQLite integration\n\nCustom SQLite XCFramework is still used for:\n- iOS app builds (Debug simulator, Release device)\n- SQLite verification workflow (builds actual iOS app)",                      
      "messageHeadline": "fix(ci): use system SQLite for macOS host tests",     
      "oid": "852432f9616a41d35da698cf2aeeedabc4c13e2e"
    },
    {
      "authoredDate": "2026-01-15T20:49:05Z",
      "authors": [
