          "login": "claude",
          "name": "Claude"
        }
      ],
      "committedDate": "2026-01-15T20:49:05Z",
      "messageBody": "Build custom SQLite 3.51.1 for macOS arm64 with the same optimization\nflags as iOS builds (THREADSAFE=2, MEMSTATUS=0, FTS5, STAT4). This\nenables macOS host tests of the C engine logic to use the custom\nSQLite library with identical compile-time options.\n\nChanges:\n- Add build-sqlite-macos job to CI and release workflows\n- Update test jobs to depend on and use macOS SQLite artifact\n- Update test scripts to detect headers at root level (macOS) or\n  Headers/ subdirectory (iOS XCFramework)",                                      
      "messageHeadline": "feat(ci): add macOS-native SQLite build for host C engine tests",                                                                     
      "oid": "a82bf1a9c1341f287f2b75deb1fbb11ec02c437b"
    },
    {
      "authoredDate": "2026-01-15T20:57:09Z",
      "authors": [
        {
