          "login": "claude",
          "name": "Claude"
        }
      ],
      "committedDate": "2026-01-15T20:57:09Z",
      "messageBody": "SQLite 3.51.2 (released 2026-01-09) fixes bugs from 3.51.1:\n- Incorrect results from nested EXISTS queries\n- FTS5vocab virtual table bug exposed by 3.51.0 optimizations\n- EXISTS-to-JOIN optimization errors\n- Obscure deadlock in Posix lock detection logic\n\nThese fixes eliminate potential query correctness risks for the\nballistics calculator's database operations.",     
      "messageHeadline": "chore: update SQLite from 3.51.1 to 3.51.2",
      "oid": "5429109827ee41e628ebbcbb3b4be3d1c5b1cc9a"
    },
    {
      "authoredDate": "2026-01-15T22:14:23Z",
