      "committedDate": "2026-01-15T22:14:23Z",
      "messageBody": "Addresses Copilot review comment - CI builds were missing\nSQLITE_ENABLE_STAT4 flag while release builds included it.\nThis inconsistency meant tests ran with different SQLite\nconfigurations than what gets released.\n\nNow all SQLite builds (iOS XCFramework, macOS native, release)\nuse identical compile flags for consistent behavior.",                                        
      "messageHeadline": "fix(ci): add STAT4 flag to iOS and macOS SQLite builds",                                                                              
      "oid": "a854bd0aee79f5a2f03aad6a33ebbf665197cf3d"
    },
