      "committedDate": "2026-01-15T22:22:57Z",
      "messageBody": "The ios-build job downloads the sqlite-xcframework artifact but\nwas not depending on the build-sqlite job that creates it. This\ncaused a race condition where the artifact might not exist when\nios-build tries to download it.",                                                                      
      "messageHeadline": "fix(ci): add build-sqlite dependency to ios-build job",                                                                               
      "oid": "76a01cc2d3b42130bcd8f302e9974629b224bcde"
