      "committedDate": "2026-01-15T23:59:22Z",
      "messageBody": "Add verification steps to help identify where the build is failing:\n- Verify downloaded artifact structure after download\n- Verify sqlite-link setup after prepare step\n- Check for presence of headers and library files\n\nThese diagnostics will be removed once the root cause is identified.",    
