      "committedDate": "2026-01-16T00:12:13Z",
      "messageBody": "The xcodebuild commands were overwriting HEADER_SEARCH_PATHS and\nLIBRARY_SEARCH_PATHS, losing the project's existing path to core/c\nheaders. This caused build failures because ballistics.h and other\nC headers couldn't be found.\n\nFix by using $(inherited) to preserve existing paths while adding\nthe sqlite-link paths.",                                                     
      "messageHeadline": "fix(ci): preserve inherited search paths in xcodebuild",                                                                              
      "oid": "23cdc099f9d3d7c2346a41c83bbffd82575be9e8"
    },
    {
      "authoredDate": "2026-01-16T00:17:40Z",
      "authors": [
