          "id": "MDQ6VXNlcjgxODQ3",
          "login": "claude",
          "name": "Claude"
        }
      ],
      "committedDate": "2026-01-16T00:17:40Z",
      "messageBody": "- Add claude/** branch pattern to ci.yml push triggers\n- Expand sqlite-verification.yml path filters to include all workflow files\n- Add scripts/** path to sqlite-verification triggers\n- Make verification-summary handle skipped jobs gracefully\n- Add Xcode selection and SwiftSyntax prebuilts to verify-binary-linking\n- Add sqlite-link verification step for better diagnostics\n- Add CODE_SIGN_IDENTITY=\"\" to verification build",                       
      "messageHeadline": "fix(ci): improve workflow triggers and verification robustness",                                                                      
      "oid": "7e8df956f1ed6e603e3709b295c069d06b81e75e"
    },
    {
      "authoredDate": "2026-01-16T00:31:03Z",
      "authors": [
        {
          "email": "noreply@anthropic.com",
          "id": "MDQ6VXNlcjgxODQ3",
          "login": "claude",
          "name": "Claude"
        }
      ],
      "committedDate": "2026-01-16T00:31:03Z",
      "messageBody": "The $(inherited) macro only inherits from parent scope (project level),\nnot from target-level settings. Since HEADER_SEARCH_PATHS is defined at\nthe target level only, $(inherited) was empty and we were losing the\ncore/c path needed for ballistics headers.\n\nFix by explicitly including $(SRCROOT)/../../../core/c in the\nHEADER_SEARCH_PATHS setting alongside the sqlite-link/Headers path.",                                                                
      "messageHeadline": "fix(ci): include core/c path in HEADER_SEARCH_PATHS explicitly",                                                                      
      "oid": "43a437890bb77d81f3c3f7d8ed185ac95ade0d91"
    },
    {
      "authoredDate": "2026-01-16T00:43:54Z",
      "authors": [
        {
          "email": "noreply@anthropic.com",
          "id": "MDQ6VXNlcjgxODQ3",
          "login": "claude",
          "name": "Claude"
        }
      ],
      "committedDate": "2026-01-16T00:43:54Z",
      "messageBody": "The path from ios/App/ (SRCROOT) to core/c requires going up 2 levels:\n- ios/App/ -> ios/ -> repo root -> core/c = ../../core/c\n\nPreviously it had 3 levels (../../../) which pointed outside the repo,\ncausing the compiler to not find ballistics.h and other C headers.\n\nFixed in:\n- project.pbxproj (both Debug and Release configurations)\n- ci.yml, release.yml, sqlite-verification.yml xcodebuild commands",                                              
      "messageHeadline": "fix: correct HEADER_SEARCH_PATHS relative path (../../ not ../../../)",                                                               
      "oid": "19dee1a5e2b09702ba702b4ec5bbfcc54aa0b49b"
    }
