 * Custom Drag Table Implementation
 *
 * SPDX-License-Identifier: BSD-2-Clause
 * Signed-off-by: Ludoplex
 */

#include "drag_table.h"
#include <string.h>
#include <stdio.h>
#include <stdlib.h>
#include <ctype.h>
#include <sqlite3.h>

/* ============================================================================
 * Internal Helpers
 * ============================================================================ */

/* Branchless min/max using arithmetic */
static inline double dmin(double a, double b) {
    return a * (a <= b) + b * (a > b);
}

static inline double dmax(double a, double b) {
    return a * (a >= b) + b * (a < b);
}

/* Safe string copy with null termination */
static void safe_strcpy(char* dst, const char* src, size_t dst_size)
{
    if (!dst || dst_size == 0) return;
    if (!src) {
        dst[0] = '\0';
        return;
    }
    size_t i = 0;
    while (i < dst_size - 1 && src[i] != '\0') {
        dst[i] = src[i];
        i++;
    }
    dst[i] = '\0';
}

/* Skip whitespace in string */
static const char* skip_whitespace(const char* p, const char* end)
{
    while (p < end && (*p == ' ' || *p == '\t' || *p == '\r')) {
        p++;
    }
    return p;
}

/* Skip to end of line */
static const char* skip_line(const char* p, const char* end)
{
    while (p < end && *p != '\n') {
        p++;
    }
    return (p < end) ? p + 1 : p;
}

/* Parse a double from string, returns pointer to next char after number */
static const char* parse_double(const char* p, const char* end, double* out)
{
    char buf[64];
    int i = 0;

    p = skip_whitespace(p, end);

    /* Handle negative sign */
    if (p < end && *p == '-') {
        buf[i++] = *p++;
    }

    /* Parse digits and decimal point */
    while (p < end && i < 63 && (isdigit((unsigned char)*p) || *p == '.')) {
        buf[i++] = *p++;
    }

    /* Handle scientific notation */
    if (p < end && i < 62 && (*p == 'e' || *p == 'E')) {
        buf[i++] = *p++;
        if (p < end && (*p == '+' || *p == '-')) {
            buf[i++] = *p++;
        }
        while (p < end && i < 63 && isdigit((unsigned char)*p)) {
            buf[i++] = *p++;
        }
    }

    buf[i] = '\0';

    if (i == 0) {
        *out = 0.0;
        return NULL;
    }

    *out = strtod(buf, NULL);
    return p;
}

/* ============================================================================
 * Core Functions
 * ============================================================================ */

int drag_table_init(DragTable* table, const char* name)
{
    if (!table) return 0;

    memset(table, 0, sizeof(DragTable));

    if (name) {
        safe_strcpy(table->name, name, DRAG_TABLE_NAME_LEN);
    }

    safe_strcpy(table->source, DRAG_TABLE_SOURCE_USER, DRAG_TABLE_SOURCE_LEN);

    return 1;
}

int drag_table_add_point(DragTable* table, double mach, double cd)
{
    if (!table) return 0;
    if (table->count >= DRAG_TABLE_MAX_POINTS) return 0;
    if (mach < 0.0 || cd < 0.0) return 0;

    table->mach[table->count] = mach;
    table->cd[table->count] = cd;
    table->count++;

    /* Keep sorted by Mach (ascending) - insertion sort for efficiency */
    int i = table->count - 1;
    while (i > 0 && table->mach[i - 1] > table->mach[i]) {
        /* Swap */
        double tmp_mach = table->mach[i];
        double tmp_cd = table->cd[i];
        table->mach[i] = table->mach[i - 1];
        table->cd[i] = table->cd[i - 1];
        table->mach[i - 1] = tmp_mach;
        table->cd[i - 1] = tmp_cd;
        i--;
    }

    return 1;
}

double drag_table_interpolate(const DragTable* table, double mach)
{
    if (!table || table->count == 0) return 0.0;
    if (table->count == 1) return table->cd[0];

    /* Clamp to table range (branchless style) */
    double min_mach = table->mach[0];
    double max_mach = table->mach[table->count - 1];

    /* Below minimum - return first Cd */
    if (mach <= min_mach) return table->cd[0];

    /* Above maximum - return last Cd */
    if (mach >= max_mach) return table->cd[table->count - 1];

    /* Binary search for the interval containing mach */
    int low = 0;
    int high = table->count - 1;

    while (high - low > 1) {
        int mid = (low + high) / 2;
        if (table->mach[mid] <= mach) {
            low = mid;
        } else {
            high = mid;
        }
    }

    /* Linear interpolation between low and high */
    double m0 = table->mach[low];
    double m1 = table->mach[high];
    double c0 = table->cd[low];
    double c1 = table->cd[high];

    double range = m1 - m0;
    if (range < 1e-10) return c0;  /* Avoid division by zero */

    double t = (mach - m0) / range;
    return c0 + t * (c1 - c0);
}

int drag_table_is_valid(const DragTable* table)
{
    if (!table) return 0;
    if (table->count < 2) return 0;

    /* Check ascending order */
    for (int i = 1; i < table->count; i++) {
        if (table->mach[i] <= table->mach[i - 1]) {
            return 0;
        }
    }

    return 1;
}

void drag_table_sort(DragTable* table)
{
    if (!table || table->count < 2) return;

    /* Simple insertion sort - tables are small */
    for (int i = 1; i < table->count; i++) {
        double key_mach = table->mach[i];
        double key_cd = table->cd[i];
        int j = i - 1;

        while (j >= 0 && table->mach[j] > key_mach) {
            table->mach[j + 1] = table->mach[j];
            table->cd[j + 1] = table->cd[j];
            j--;
        }

        table->mach[j + 1] = key_mach;
        table->cd[j + 1] = key_cd;
    }
}

int drag_table_get_range(const DragTable* table, double* min_mach, double* max_mach)
{
    if (!table || table->count == 0) return 0;

    if (min_mach) *min_mach = table->mach[0];
    if (max_mach) *max_mach = table->mach[table->count - 1];

    return 1;
}

/* ============================================================================
 * Parsing Functions
 * ============================================================================ */

int drag_table_parse_jbm(DragTable* table, const char* data, size_t len)
{
    if (!table || !data || len == 0) return -1;

    drag_table_init(table, NULL);
    safe_strcpy(table->source, DRAG_TABLE_SOURCE_JBM, DRAG_TABLE_SOURCE_LEN);

    const char* p = data;
    const char* end = data + len;
    int count = 0;

    while (p < end && count < DRAG_TABLE_MAX_POINTS) {
        /* Skip leading whitespace */
        p = skip_whitespace(p, end);
        if (p >= end) break;

        /* Skip empty lines and comments */
        if (*p == '\n' || *p == '#') {
            p = skip_line(p, end);
            continue;
        }

        /* Parse Mach number */
        double mach = 0.0;
        const char* next = parse_double(p, end, &mach);
        if (!next) {
            p = skip_line(p, end);
            continue;
        }
        p = next;

        /* Skip separator (tab or whitespace) */
        p = skip_whitespace(p, end);
        if (p >= end) break;

        /* Parse Cd */
        double cd = 0.0;
        next = parse_double(p, end, &cd);
        if (!next) {
            p = skip_line(p, end);
            continue;
        }
        p = next;

        /* Add point */
        if (mach >= 0.0 && cd > 0.0) {
            table->mach[count] = mach;
            table->cd[count] = cd;
            count++;
        }

        /* Skip to next line */
        p = skip_line(p, end);
    }

    table->count = count;
    drag_table_sort(table);

    return count;
}

int drag_table_parse_csv(DragTable* table, const char* data, size_t len)
{
    if (!table || !data || len == 0) return -1;

    drag_table_init(table, NULL);
    safe_strcpy(table->source, DRAG_TABLE_SOURCE_AB, DRAG_TABLE_SOURCE_LEN);

    const char* p = data;
    const char* end = data + len;
    int count = 0;
    int is_first_line = 1;

    while (p < end && count < DRAG_TABLE_MAX_POINTS) {
        /* Skip leading whitespace */
        p = skip_whitespace(p, end);
        if (p >= end) break;

        /* Skip empty lines */
        if (*p == '\n') {
            p++;
            continue;
        }

        /* Parse first value */
        double val1 = 0.0;
        const char* next = parse_double(p, end, &val1);

        /* If first line and parse fails, assume header - skip */
        if (!next && is_first_line) {
            p = skip_line(p, end);
            is_first_line = 0;
            continue;
        }

        if (!next) {
            p = skip_line(p, end);
            continue;
        }
        p = next;
        is_first_line = 0;

        /* Skip comma separator */
        while (p < end && (*p == ',' || *p == ' ' || *p == '\t')) {
            p++;
        }
        if (p >= end) break;

        /* Parse second value */
        double val2 = 0.0;
        next = parse_double(p, end, &val2);
        if (!next) {
            p = skip_line(p, end);
            continue;
        }
        p = next;

        /* Add point (Mach, Cd) */
        if (val1 >= 0.0 && val2 > 0.0) {
            table->mach[count] = val1;
            table->cd[count] = val2;
            count++;
        }

        p = skip_line(p, end);
    }

    table->count = count;
    drag_table_sort(table);

    return count;
}

int drag_table_parse_json(DragTable* table, const char* data, size_t len)
{
    if (!table || !data || len == 0) return -1;

    drag_table_init(table, NULL);
    safe_strcpy(table->source, DRAG_TABLE_SOURCE_LAPUA, DRAG_TABLE_SOURCE_LEN);

    const char* p = data;
    const char* end = data + len;
    int count = 0;

    /* Simple JSON parsing - look for "mach" and "cd" keys */
    while (p < end && count < DRAG_TABLE_MAX_POINTS) {
        /* Find "mach" key */
        const char* mach_key = strstr(p, "\"mach\"");
        if (!mach_key || mach_key >= end) break;

        /* Find colon and parse value */
        p = mach_key + 6;
        while (p < end && *p != ':') p++;
        if (p >= end) break;
        p++; /* Skip colon */

        double mach = 0.0;
        const char* next = parse_double(p, end, &mach);
        if (!next) {
            p++;
            continue;
        }
        p = next;

        /* Find "cd" key nearby */
        const char* cd_key = strstr(p, "\"cd\"");
        if (!cd_key || cd_key >= end) break;

        /* Find colon and parse value */
        p = cd_key + 4;
        while (p < end && *p != ':') p++;
        if (p >= end) break;
        p++; /* Skip colon */

        double cd = 0.0;
        next = parse_double(p, end, &cd);
        if (!next) {
            p++;
            continue;
        }
        p = next;

        /* Add point */
        if (mach >= 0.0 && cd > 0.0) {
            table->mach[count] = mach;
            table->cd[count] = cd;
            count++;
        }
    }

    table->count = count;
    drag_table_sort(table);

    return count;
}

int drag_table_parse_auto(DragTable* table, const char* data, size_t len)
{
    if (!table || !data || len == 0) return -1;

    /* Skip leading whitespace */
    const char* p = data;
    const char* end = data + len;
    while (p < end && (*p == ' ' || *p == '\t' || *p == '\r' || *p == '\n')) {
        p++;
    }

    if (p >= end) return -1;

    /* Detect format */
    if (*p == '{' || *p == '[') {
        /* JSON format */
        return drag_table_parse_json(table, data, len);
    }

    /* Check for comma (CSV) vs tab (JBM) */
    const char* comma = memchr(p, ',', end - p);
    const char* tab = memchr(p, '\t', end - p);
    const char* newline = memchr(p, '\n', end - p);

    /* If comma appears before tab and before newline, it's CSV */
    if (comma && (!tab || comma < tab) && (!newline || comma < newline)) {
        return drag_table_parse_csv(table, data, len);
    }

    /* Default to JBM (tab-separated or space-separated) */
    return drag_table_parse_jbm(table, data, len);
}

/* ============================================================================
 * File I/O
 * ============================================================================ */

int drag_table_load_file(DragTable* table, const char* path)
{
    if (!table || !path) return -1;

    FILE* f = fopen(path, "rb");
    if (!f) return -1;

    /* Get file size */
    fseek(f, 0, SEEK_END);
    long size = ftell(f);
    fseek(f, 0, SEEK_SET);

    if (size <= 0 || size > 1024 * 1024) {  /* Max 1MB */
        fclose(f);
        return -1;
    }

    /* Read file */
    char* data = (char*)malloc(size + 1);
    if (!data) {
        fclose(f);
        return -1;
    }

    size_t read = fread(data, 1, size, f);
    fclose(f);

    if ((long)read != size) {
        free(data);
        return -1;
    }
    data[size] = '\0';

    /* Extract filename for table name */
    const char* name = strrchr(path, '/');
    if (!name) name = strrchr(path, '\\');
    name = name ? name + 1 : path;

    /* Parse */
    int result = drag_table_parse_auto(table, data, size);

    if (result > 0) {
        safe_strcpy(table->name, name, DRAG_TABLE_NAME_LEN);
    }

    free(data);
    return result;
}

/* ============================================================================
 * SQLite Persistence
 * ============================================================================ */

int drag_table_save(DragTable* table, sqlite3* db)
{
    if (!table || !db) return 0;
    if (table->count == 0) return 0;

    char* err_msg = NULL;
    int rc;

    /* Begin transaction */
    rc = sqlite3_exec(db, "BEGIN TRANSACTION", NULL, NULL, &err_msg);
    if (rc != SQLITE_OK) {
        sqlite3_free(err_msg);
        return 0;
    }

    sqlite3_stmt* stmt = NULL;

    if (table->id == 0) {
        /* Insert new table */
        const char* sql = "INSERT INTO custom_drag_tables (name, source, description) VALUES (?, ?, ?)";
        rc = sqlite3_prepare_v2(db, sql, -1, &stmt, NULL);
        if (rc != SQLITE_OK) goto rollback;

        sqlite3_bind_text(stmt, 1, table->name, -1, SQLITE_STATIC);
        sqlite3_bind_text(stmt, 2, table->source, -1, SQLITE_STATIC);
        sqlite3_bind_null(stmt, 3);

        rc = sqlite3_step(stmt);
        sqlite3_finalize(stmt);

        if (rc != SQLITE_DONE) goto rollback;

        table->id = (int)sqlite3_last_insert_rowid(db);
    } else {
        /* Update existing table */
        const char* sql = "UPDATE custom_drag_tables SET name = ?, source = ?, updated_at = strftime('%s', 'now') WHERE id = ?";
        rc = sqlite3_prepare_v2(db, sql, -1, &stmt, NULL);
        if (rc != SQLITE_OK) goto rollback;

        sqlite3_bind_text(stmt, 1, table->name, -1, SQLITE_STATIC);
        sqlite3_bind_text(stmt, 2, table->source, -1, SQLITE_STATIC);
        sqlite3_bind_int(stmt, 3, table->id);

        rc = sqlite3_step(stmt);
        sqlite3_finalize(stmt);

        if (rc != SQLITE_DONE) goto rollback;

        /* Delete existing points */
        const char* del_sql = "DELETE FROM drag_table_points WHERE table_id = ?";
        rc = sqlite3_prepare_v2(db, del_sql, -1, &stmt, NULL);
        if (rc != SQLITE_OK) goto rollback;

        sqlite3_bind_int(stmt, 1, table->id);
        rc = sqlite3_step(stmt);
        sqlite3_finalize(stmt);

        if (rc != SQLITE_DONE) goto rollback;
    }

    /* Insert points */
    const char* point_sql = "INSERT INTO drag_table_points (table_id, mach, cd) VALUES (?, ?, ?)";
    rc = sqlite3_prepare_v2(db, point_sql, -1, &stmt, NULL);
    if (rc != SQLITE_OK) goto rollback;

    for (int i = 0; i < table->count; i++) {
        sqlite3_reset(stmt);
        sqlite3_bind_int(stmt, 1, table->id);
        sqlite3_bind_double(stmt, 2, table->mach[i]);
        sqlite3_bind_double(stmt, 3, table->cd[i]);

        rc = sqlite3_step(stmt);
        if (rc != SQLITE_DONE) {
            sqlite3_finalize(stmt);
            goto rollback;
        }
    }

    sqlite3_finalize(stmt);

    /* Commit */
    rc = sqlite3_exec(db, "COMMIT", NULL, NULL, &err_msg);
    if (rc != SQLITE_OK) {
        sqlite3_free(err_msg);
        goto rollback;
    }

    return 1;

rollback:
    sqlite3_exec(db, "ROLLBACK", NULL, NULL, NULL);
    return 0;
}

int drag_table_load(DragTable* table, sqlite3* db, int id)
{
    if (!table || !db || id <= 0) return 0;

    drag_table_init(table, NULL);

    sqlite3_stmt* stmt = NULL;
    int rc;

    /* Load metadata */
    const char* meta_sql = "SELECT name, source FROM custom_drag_tables WHERE id = ?";
    rc = sqlite3_prepare_v2(db, meta_sql, -1, &stmt, NULL);
    if (rc != SQLITE_OK) return 0;

    sqlite3_bind_int(stmt, 1, id);

    rc = sqlite3_step(stmt);
    if (rc != SQLITE_ROW) {
        sqlite3_finalize(stmt);
        return 0;
    }

    const char* name = (const char*)sqlite3_column_text(stmt, 0);
    const char* source = (const char*)sqlite3_column_text(stmt, 1);

    if (name) safe_strcpy(table->name, name, DRAG_TABLE_NAME_LEN);
    if (source) safe_strcpy(table->source, source, DRAG_TABLE_SOURCE_LEN);
    table->id = id;

    sqlite3_finalize(stmt);

    /* Load points */
    const char* point_sql = "SELECT mach, cd FROM drag_table_points WHERE table_id = ? ORDER BY mach ASC";
    rc = sqlite3_prepare_v2(db, point_sql, -1, &stmt, NULL);
    if (rc != SQLITE_OK) return 0;

    sqlite3_bind_int(stmt, 1, id);

    int count = 0;
    while ((rc = sqlite3_step(stmt)) == SQLITE_ROW && count < DRAG_TABLE_MAX_POINTS) {
        table->mach[count] = sqlite3_column_double(stmt, 0);
        table->cd[count] = sqlite3_column_double(stmt, 1);
        count++;
    }

    sqlite3_finalize(stmt);
    table->count = count;

    return (count > 0) ? 1 : 0;
}

int drag_table_delete(sqlite3* db, int id)
{
    if (!db || id <= 0) return 0;

    sqlite3_stmt* stmt = NULL;
    int rc;

    /* Points are deleted automatically via ON DELETE CASCADE */
    const char* sql = "DELETE FROM custom_drag_tables WHERE id = ?";
    rc = sqlite3_prepare_v2(db, sql, -1, &stmt, NULL);
    if (rc != SQLITE_OK) return 0;

    sqlite3_bind_int(stmt, 1, id);
    rc = sqlite3_step(stmt);
    sqlite3_finalize(stmt);

    return (rc == SQLITE_DONE) ? 1 : 0;
}

int drag_table_list(sqlite3* db, DragTable* tables, int max, int* count)
{
    if (!db || !tables || max <= 0 || !count) return 0;

    *count = 0;

    sqlite3_stmt* stmt = NULL;
    int rc;

    const char* sql = "SELECT id, name, source, point_count FROM custom_drag_tables ORDER BY name ASC LIMIT ?";
    rc = sqlite3_prepare_v2(db, sql, -1, &stmt, NULL);
    if (rc != SQLITE_OK) return 0;

    sqlite3_bind_int(stmt, 1, max);

    int n = 0;
    while ((rc = sqlite3_step(stmt)) == SQLITE_ROW && n < max) {
        drag_table_init(&tables[n], NULL);

        tables[n].id = sqlite3_column_int(stmt, 0);

        const char* name = (const char*)sqlite3_column_text(stmt, 1);
        const char* source = (const char*)sqlite3_column_text(stmt, 2);

        if (name) safe_strcpy(tables[n].name, name, DRAG_TABLE_NAME_LEN);
        if (source) safe_strcpy(tables[n].source, source, DRAG_TABLE_SOURCE_LEN);

        tables[n].count = sqlite3_column_int(stmt, 3);

        n++;
    }

    sqlite3_finalize(stmt);
    *count = n;

    return 1;
}

int drag_table_load_by_name(DragTable* table, sqlite3* db, const char* name)
{
    if (!table || !db || !name) return 0;

    sqlite3_stmt* stmt = NULL;
    int rc;

    const char* sql = "SELECT id FROM custom_drag_tables WHERE name = ?";
    rc = sqlite3_prepare_v2(db, sql, -1, &stmt, NULL);
    if (rc != SQLITE_OK) return 0;

    sqlite3_bind_text(stmt, 1, name, -1, SQLITE_STATIC);

    rc = sqlite3_step(stmt);
    if (rc != SQLITE_ROW) {
        sqlite3_finalize(stmt);
        return 0;
    }

    int id = sqlite3_column_int(stmt, 0);
    sqlite3_finalize(stmt);

    return drag_table_load(table, db, id);
}

