{"contents":"/*
 * Multi-Point Ballistic Coefficient Curves - Implementation
 *
 * SPDX-License-Identifier: BSD-2-Clause
 * Signed-off-by: Ludoplex
 */

#include "bc_curve.h"
#include <string.h>

/* ============================================================================
 * Initialization Functions
 * ============================================================================ */

void bc_curve_init_single(BCCurve* curve, double bc, int drag_model)
{
    if (!curve) return;

    memset(curve, 0, sizeof(BCCurve));
    curve->bc[0] = bc;
    curve->velocity[0] = 3500.0;  /* Default high velocity */
    curve->count = 1;
    curve->drag_model = drag_model;
}

int bc_curve_init_array(BCCurve* curve,
                         const double* bc,
                         const double* velocity,
                         int count,
                         int drag_model)
{
    if (!curve || !bc || !velocity) return 0;
    if (count < 1 || count > BC_CURVE_MAX_POINTS) return 0;

    memset(curve, 0, sizeof(BCCurve));

    for (int i = 0; i < count; i++) {
        curve->bc[i] = bc[i];
        curve->velocity[i] = velocity[i];
    }

    curve->count = count;
    curve->drag_model = drag_model;

    /* Sort by velocity descending */
    bc_curve_sort(curve);

    return 1;
}

/* ============================================================================
 * Point Management
 * ============================================================================ */

int bc_curve_add_point(BCCurve* curve, double bc, double velocity_fps)
{
    if (!curve) return 0;
    if (curve->count >= BC_CURVE_MAX_POINTS) return 0;

    curve->bc[curve->count] = bc;
    curve->velocity[curve->count] = velocity_fps;
    curve->count++;

    /* Keep sorted by velocity descending */
    bc_curve_sort(curve);

    return 1;
}

void bc_curve_sort(BCCurve* curve)
{
    if (!curve || curve->count < 2) return;

    /* Simple insertion sort (small array, max 5 elements) */
    for (int i = 1; i < curve->count; i++) {
        double bc_temp = curve->bc[i];
        double vel_temp = curve->velocity[i];
        int j = i - 1;

        /* Sort descending by velocity */
        while (j >= 0 && curve->velocity[j] < vel_temp) {
            curve->bc[j + 1] = curve->bc[j];
            curve->velocity[j + 1] = curve->velocity[j];
            j--;
        }

        curve->bc[j + 1] = bc_temp;
        curve->velocity[j + 1] = vel_temp;
    }
}

/* ============================================================================
 * Interpolation
 * ============================================================================ */

double bc_curve_interpolate(const BCCurve* curve, double velocity_fps)
{
    if (!curve || curve->count == 0) return 0.0;

    /* Single point - no interpolation needed */
    if (curve->count == 1) {
        return curve->bc[0];
    }

    /* Velocity above highest point - clamp to first BC */
    if (velocity_fps >= curve->velocity[0]) {
        return curve->bc[0];
    }

    /* Velocity below lowest point - clamp to last BC */
    if (velocity_fps <= curve->velocity[curve->count - 1]) {
        return curve->bc[curve->count - 1];
    }

    /* Find the two points to interpolate between */
    /* Points are sorted descending by velocity */
    for (int i = 0; i < curve->count - 1; i++) {
        double v_high = curve->velocity[i];
        double v_low = curve->velocity[i + 1];

        if (velocity_fps <= v_high && velocity_fps >= v_low) {
            /* Linear interpolation */
            double bc_high = curve->bc[i];
            double bc_low = curve->bc[i + 1];

            /* Avoid division by zero */
            double v_range = v_high - v_low;
            if (v_range < 1.0) {
                return bc_high;
            }

            /* Interpolation factor (0 = at v_high, 1 = at v_low) */
            double t = (v_high - velocity_fps) / v_range;

            return bc_high + t * (bc_low - bc_high);
        }
    }

    /* Fallback (should not reach here) */
    return curve->bc[0];
}

/* ============================================================================
 * Utility Functions
 * ============================================================================ */

int bc_curve_get_drag_model(const BCCurve* curve)
{
    if (!curve) return BC_DRAG_MODEL_G1;
    return curve->drag_model;
}

int bc_curve_is_valid(const BCCurve* curve)
{
    if (!curve) return 0;
    if (curve->count < 1 || curve->count > BC_CURVE_MAX_POINTS) return 0;

    /* Check that all BC values are positive */
    for (int i = 0; i < curve->count; i++) {
        if (curve->bc[i] <= 0.0) return 0;
        if (curve->velocity[i] <= 0.0) return 0;
    }

    /* Check drag model is valid */
    if (curve->drag_model != BC_DRAG_MODEL_G1 &&
        curve->drag_model != BC_DRAG_MODEL_G7) {
        return 0;
    }

    return 1;
}

