static double interpolate(const double* x_table, const double* y_table,
                          int table_size, double x) {
    // Handle edge cases
    if (x <= x_table[0]) {
        return y_table[0];
    }
    if (x >= x_table[table_size - 1]) {
        return y_table[table_size - 1];
    }

    // Binary search for the interval
    int low = 0;
    int high = table_size - 1;

    while (high - low > 1) {
        int mid = (low + high) / 2;
        if (x_table[mid] <= x) {
            low = mid;
        } else {
            high = mid;
        }
    }

    // Linear interpolation
    double x0 = x_table[low];
    double x1 = x_table[high];
    double y0 = y_table[low];
    double y1 = y_table[high];

    return y0 + (y1 - y0) * (x - x0) / (x1 - x0);
}

