                        (int)model, bc, yards, velocity, initial_velocity, 100.0*velocity/initial_velocity);
                vel_log_count++;
            }
        }
        // #endregion
    }

    return velocity;
}

double drag_time_of_flight(DragModel model, double initial_velocity,
                           double bc, double distance,
                           double air_density, double speed_of_sound) {
    if (initial_velocity <= 0.0 || bc <= 0.0 || distance < 0.0) {
        return 0.0;
    }

    // Numerical integration using small steps
    const double step_size = 1.0;  // 1 foot steps
    double velocity = initial_velocity;
    double remaining_distance = distance;
    double total_time = 0.0;

    while (remaining_distance > 0.0 && velocity > 0.0) {
