            continue;
        }
        p = next;

        /* Add point (Mach, Cd) */
        if (val1 >= 0.0 && val2 > 0.0) {
            table->mach[count] = val1;
            table->cd[count] = val2;
            count++;
        }

        p = skip_line(p, end);
    }

    table->count = count;
    drag_table_sort(table);

