{"contents":"/*
 * BC Truing - Implementation
 *
 * SPDX-License-Identifier: BSD-2-Clause
 * Signed-off-by: Ludoplex
 */

#include "truing.h"
#include "ballistics.h"
#include "drag_models.h"
#include <math.h>
#include <string.h>

/* ============================================================================
 * Constants
 * ============================================================================ */

#define DEFAULT_MAX_ADJUSTMENT     0.20    /* 20% max adjustment */
#define DEFAULT_MIN_RANGE          300.0   /* yards */
#define DEFAULT_TOLERANCE          0.1     /* inches */
#define DEFAULT_MAX_ITERATIONS     50

/* ============================================================================
 * Initialization
 * ============================================================================ */

void truing_init_options(TruingOptions* options)
{
    if (!options) return;

    memset(options, 0, sizeof(TruingOptions));

    /* Default atmosphere (standard conditions) */
    options->atmosphere.temperature_f = 59.0;
    options->atmosphere.pressure_inhg = 29.92;
    options->atmosphere.humidity_percent = 0.0;
    options->atmosphere.altitude_ft = 0.0;

    /* Default solver settings */
    options->max_adjustment_factor = DEFAULT_MAX_ADJUSTMENT;
    options->min_range_yards = DEFAULT_MIN_RANGE;
    options->tolerance_inches = DEFAULT_TOLERANCE;
    options->max_iterations = DEFAULT_MAX_ITERATIONS;
}

/* ============================================================================
 * Validation
 * ============================================================================ */

int truing_validate_input(const TruingInput* input)
{
    if (!input) return 0;

    /* Range must be positive */
    if (input->range_yards <= 0) return 0;

    /* BC must be positive */
    if (input->original_bc <= 0) return 0;

    /* Velocity must be positive */
    if (input->muzzle_velocity_fps <= 0) return 0;

    /* Drops can be any value (including positive for uphill) */
    /* but actual and predicted should exist */

    /* Drag model must be valid */
    if (input->drag_model != BC_DRAG_MODEL_G1 &&
        input->drag_model != BC_DRAG_MODEL_G7) {
        return 0;
    }

    return 1;
}

/* ============================================================================
 * Helper: Calculate drop at range with given BC
 * ============================================================================ */

static double calculate_drop_with_bc(const TruingInput* input,
                                      const TruingOptions* options,
                                      double bc)
{
    /* Create a minimal ballistics input for drop calculation */
    BallisticsInput bi;
    memset(&bi, 0, sizeof(BallisticsInput));

    bi.muzzle_velocity_fps = input->muzzle_velocity_fps;
    bi.sight_height_inches = input->sight_height_inches;
    bi.zero_range_yards = input->zero_range_yards;
    bi.ballistic_coefficient = bc;
    bi.target_range_yards = input->range_yards;

    /* Set drag model */
    bi.drag_model = (input->drag_model == BC_DRAG_MODEL_G7) ?
                    DRAG_MODEL_G7 : DRAG_MODEL_G1;

    /* Set atmosphere if provided */
    if (options) {
        bi.atmosphere = options->atmosphere;
    } else {
        bi.atmosphere.temperature_f = 59.0;
        bi.atmosphere.pressure_inhg = 29.92;
        bi.atmosphere.humidity_percent = 0.0;
        bi.atmosphere.altitude_ft = 0.0;
    }

    /* Calculate drop */
    return ballistics_drop(&bi, input->range_yards);
}

/* ============================================================================
 * Confidence Score
 * ============================================================================ */

double truing_confidence_score(const TruingInput* input,
                                double adjustment_factor)
{
    if (!input) return 0.0;

    double confidence = 1.0;

    /* Range factor: longer range = more reliable */
    /* Full confidence at 600+ yards, reduced below 300 */
    double range_factor;
    if (input->range_yards >= 600.0) {
        range_factor = 1.0;
    } else if (input->range_yards >= 300.0) {
        range_factor = 0.5 + 0.5 * (input->range_yards - 300.0) / 300.0;
    } else {
        range_factor = 0.3 + 0.2 * input->range_yards / 300.0;
    }
    confidence *= range_factor;

    /* Adjustment magnitude factor: smaller adjustment = more reliable */
    /* Full confidence for < 5% adjustment, reduced above 10% */
    double adj_delta = fabs(adjustment_factor - 1.0);
    double adj_factor;
    if (adj_delta <= 0.05) {
        adj_factor = 1.0;
    } else if (adj_delta <= 0.10) {
        adj_factor = 1.0 - (adj_delta - 0.05) * 4.0;  /* Linear reduction */
    } else if (adj_delta <= 0.20) {
        adj_factor = 0.8 - (adj_delta - 0.10) * 3.0;
    } else {
        adj_factor = 0.5;
    }
    confidence *= adj_factor;

    /* Drop delta factor: closer prediction = more reliable truing */
    double drop_delta = fabs(input->actual_drop_inches - input->predicted_drop_inches);
    double delta_factor;
    if (drop_delta <= 5.0) {
        delta_factor = 1.0;
    } else if (drop_delta <= 20.0) {
        delta_factor = 1.0 - (drop_delta - 5.0) / 30.0;
    } else {
        delta_factor = 0.5;
    }
    confidence *= delta_factor;

    /* Clamp to 0.0 - 1.0 */
    if (confidence < 0.0) confidence = 0.0;
    if (confidence > 1.0) confidence = 1.0;

    return confidence;
}

/* ============================================================================
 * Main Truing Calculation
 * ============================================================================ */

TruingResult truing_calculate_bc(const TruingInput* input,
                                  const TruingOptions* options)
{
    TruingResult result;
    memset(&result, 0, sizeof(TruingResult));

    /* Default options if not provided */
    TruingOptions default_opts;
    if (!options) {
        truing_init_options(&default_opts);
        options = &default_opts;
    }

    /* Validate input */
    if (!truing_validate_input(input)) {
        result.valid = 0;
        result.error_message = "Invalid truing input";
        return result;
    }

    /* Check minimum range */
    if (input->range_yards < options->min_range_yards) {
        result.valid = 0;
        result.error_message = "Range too short for reliable truing";
        return result;
    }

    /* Calculate drop delta */
    double drop_delta = input->actual_drop_inches - input->predicted_drop_inches;

    /* If drops are essentially equal, BC is already correct */
    if (fabs(drop_delta) < options->tolerance_inches) {
        result.adjusted_bc = input->original_bc;
        result.adjustment_factor = 1.0;
        result.confidence = 1.0;
        result.valid = 1;
        result.error_message = NULL;
        return result;
    }

    /* Use bisection to find BC that produces actual drop */
    /* BC range: original_bc * (1 - max_adj) to original_bc * (1 + max_adj) */
    double bc_low = input->original_bc * (1.0 - options->max_adjustment_factor);
    double bc_high = input->original_bc * (1.0 + options->max_adjustment_factor);
    double bc_mid;

    /* Ensure BC bounds are valid */
    if (bc_low < 0.1) bc_low = 0.1;
    if (bc_high > 2.0) bc_high = 2.0;

    double target_drop = input->actual_drop_inches;
    double drop_low = calculate_drop_with_bc(input, options, bc_low);
    double drop_high = calculate_drop_with_bc(input, options, bc_high);

    /* Check if solution exists within bounds */
    /* Higher BC = less drop (magnitude), lower BC = more drop */
    /* Note: drop is typically negative (below line of sight) */
    int solution_exists = (drop_low <= target_drop && target_drop <= drop_high) ||
                          (drop_high <= target_drop && target_drop <= drop_low);

    if (!solution_exists) {
        /* Target is outside our adjustment range */
        result.valid = 0;
        result.error_message = "Required adjustment exceeds maximum allowed";
        return result;
    }

    /* Bisection iteration */
    for (int i = 0; i < options->max_iterations; i++) {
        bc_mid = (bc_low + bc_high) / 2.0;
        double drop_mid = calculate_drop_with_bc(input, options, bc_mid);

        /* Check convergence */
        if (fabs(drop_mid - target_drop) < options->tolerance_inches) {
            break;
        }

        /* Adjust bounds */
        /* If drop_mid is more negative than target (more drop), need higher BC */
        if ((drop_mid < target_drop && drop_low < drop_high) ||
            (drop_mid > target_drop && drop_low > drop_high)) {
            bc_low = bc_mid;
            drop_low = drop_mid;
        } else {
            bc_high = bc_mid;
            drop_high = drop_mid;
        }
    }

    /* Finalize result */
    result.adjusted_bc = bc_mid;
    result.adjustment_factor = bc_mid / input->original_bc;
    result.confidence = truing_confidence_score(input, result.adjustment_factor);
    result.valid = 1;
    result.error_message = NULL;

    return result;
}

/* ============================================================================
 * Apply Truing to BC Curve
 * ============================================================================ */

void truing_apply_to_curve(BCCurve* curve, double adjustment_factor)
{
    if (!curve || adjustment_factor <= 0) return;

    for (int i = 0; i < curve->count; i++) {
        curve->bc[i] *= adjustment_factor;
    }
}

